import Link from 'next/link';

const navbar = () =>( 
    <div>
        <ul>
<li><Link href="/"><a>home</a></Link></li>
 <li><Link href="/about"><a>about</a></Link></li> 
</ul> 
<style jsx>{`
    ul {
        background:#333;
        color:#fff;
        list-style:none;
        display:flex;
    }
    ul li{
        font-size:18px;
        marfin-right:20px;
        padding-right:20px;
    }
    ul li a{
        color:#fff;
        text-decoration: none;
    }
`}</style>
    </div>
)

export default navbar
